import React from 'react'
import styled from 'styled-components';

function Game() {
    return (
        <Container>
            <ContainerChildLeft>
                left
            </ContainerChildLeft>
            <ContainerChildRight>
                right
            </ContainerChildRight>
        </Container>
    )
}

export default Game

const Container = styled.div`
    display: flex;
`

const ContainerChildLeft = styled.div`
    background-color: white;
`

const ContainerChildRight = styled.div`
    display: flex;
    
    background-color: red;
    
`
